column8:
■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">ダイワ (DAIWA) グローブライド 銀狼ガンマ 1500 / 磯釣り用ナイロン道糸<br /><br />さらに進化したNANODIS15000で耐摩耗性1500％<br /><br />耐摩耗性にこだわったチヌ専用ライン。<br />最先端NANODIS1500の分散技術により従来比15倍（当社比）という驚異の耐摩耗性能を実現。チヌ釣りでの視認性にこだわったスペシャルピンク50cmにブラックマーキング20cm繰返し。視認性も良いのでラインメンディングもしやすい。<br /><br />「NANODIS1000」をさらに上回る最先端のナノ分散技術「NANODIS1500」を確立したことにより、従来比15倍（当社比）という耐摩耗性能を得ることに成功。微細なナノ分子を均一かつ密にナイロン組成内に分散させ、結節強力も飛躍的に向上。ライン表面に施した特殊撥水加工は高度なライン操作をサポートする。やや伸びを抑えた糸質は振動伝達性に優れ、SMT（スーパーメタルトップ）搭載ロッド、ウキ、ハリ等を効率的に組み合わせることで、手感度・目感度ともに研ぎ澄まされた超高感度システムを構築することが可能。<br /><br />■カラー：スペシャルピンク<br /><br />■発売年：2017年<br /></font></td></tr></table><STYLE type="text/css">
